Warm birthday wishes to dear Aadesh Rawal ji , 
May god bless him with good health, peace and prosperity 
@AadeshRawal

Yesterday Visited the historic Sevagram Ashram, Nagpur 
Later, attended the reception ceremony of AICC Secretary’s daughter, Yesahwini and Abhay , in Nagpur. It was a joyous occasion shared with my fellow AICC Secretaries and friends. Wishing the young couple a lifetime of happiness and togetherness!
@RamkishanO

