text:
ಎಲ್ಲರಿಗೂ ಸಂವಿಧಾನ ದಿನದ ಶುಭಾಶಯಗಳು

𝐖𝐄, 𝐓𝐇𝐄 𝐏𝐄𝐎𝐏𝐋𝐄 𝐎𝐅 𝐈𝐍𝐃𝐈𝐀, having solemnly resolved to constitute India into a 𝐒𝐎𝐕𝐄𝐑𝐄𝐈𝐆𝐍 𝐒𝐎𝐂𝐈𝐀𝐋𝐈𝐒𝐓 𝐒𝐄𝐂𝐔𝐋𝐀𝐑 𝐃𝐄𝐌𝐎𝐂𝐑𝐀𝐓𝐈𝐂 𝐑𝐄𝐏𝐔𝐁𝐋𝐈𝐂 and to secure to all its citizens:
𝐉𝐔𝐒𝐓𝐈𝐂𝐄, social, economic and political;
𝐋𝐈𝐁𝐄𝐑𝐓𝐘 of thought, expression, belief, faith and worship;
𝐄𝐐𝐔𝐀𝐋𝐈𝐓𝐘 of status and of opportunity;
and to promote among them all
𝐅𝐑𝐀𝐓𝐄𝐑𝐍𝐈𝐓𝐘 assuring the dignity of the individual and the unity and integrity of the Nation;
𝐈𝐍 𝐎𝐔𝐑 𝐂𝐎𝐍𝐒𝐓𝐈𝐓𝐔𝐄𝐍𝐓 𝐀𝐒𝐒𝐄𝐌𝐁𝐋𝐘 this twenty-sixth day of November, 1949, do 𝐇𝐄𝐑𝐄𝐁𝐘 𝐀𝐃𝐎𝐏𝐓, 𝐄𝐍𝐀𝐂𝐓 𝐀𝐍𝐃 𝐆𝐈𝐕𝐄 𝐓𝐎 𝐎𝐔𝐑𝐒𝐄𝐋𝐕𝐄𝐒 𝐓𝐇𝐈𝐒 𝐂𝐎𝐍𝐒𝐓𝐈𝐓𝐔𝐓𝐈𝐎𝐍.

मतदानाचा हक्क बजावून लोकशाही बळकट करणाऱ्या सर्व जागरूक मतदारांचे मनःपूर्वक आभार.

